    constructor(props){
        super(props)
        this.state={
            topList:[],
            albums:[]
        }
    }

    componentDidMount(){
        fetch('https://thingproxy.freeboard.io/fetch/https://api.deezer.com/chart/0/tracks&top?limit=10')
        .then(resp => resp.json())
        .then(data => this.setState({
            topList: data.data
        }))
        .catch(err => console.log(err))
    }


  render() {
    return (
